Sure, here's an example of a unit test for the `updateTierConfigService` function:

```
const dealerRepository = require('../../repositories/dealer');
const { updateTierConfigService } = require('./updateTierConfigService');

jest.mock('../../repositories/dealer');

describe('updateTierConfigService', () => {
  it('should update all dealer references with the given payload', async () => {
    const payload = {
      uuid: 'tier-uuid',
      plafond: 10000,
      max_inventory: 50000,
      min_loan_amount: 1000,
      ltv_percentage: 80,
    };
    const dealerReferences = [
      {
        id: 1,
        tier_uuid: 'tier-uuid',
        total_active_loan_amount: 2000,
        total_active_loan: 2,
      },
      {
        id: 2,
        tier_uuid: 'tier-uuid',
        total_active_loan_amount: 3000,
        total_active_loan: 3,
      },
    ];
    dealerRepository.getAllDealerReferencesByTierUuid.mockResolvedValue(dealerReferences);
    dealerRepository.updateDealerReferenceById.mockResolvedValue(true);

    const result = await updateTierConfigService(payload);

    expect(dealerRepository.getAllDealerReferencesByTierUuid).toHaveBeenCalledWith('tier-uuid');
    expect(dealerRepository.updateDealerReferenceById).toHaveBeenCalledTimes(2);
    expect(dealerRepository.updateDealerReferenceById).toHaveBeenCalledWith(
      {
        remaining_plafond: 8000,
        remaining_loan_quota: 47000,
        max_loan_quota: 50000,
        max_plafond: 10000,
        min_loan_amount: 1000,
        ltv_percentage: 80,
      },
      1
    );
    expect(dealerRepository.updateDealerReferenceById).toHaveBeenCalledWith(
      {
        remaining_plafond: 7000,
        remaining_loan_quota: 47000,
        max_loan_quota: 50000,
        max_plafond: 10000,
        min_loan_amount: 1000,
        ltv_percentage: 80,
      },
      2
    );
    expect(result).toBe(true);
  });
});
```

This test checks that the function correctly updates all dealer references with the given payload, and returns `true` when finished. It uses Jest to mock the `dealerRepository` module and its functions, and to assert that the expected functions are called with the expected arguments.

